import Product from "./Product";
import ExclusiveDeal from "./ExclusiveDeal";
import Brand from "./Brand";
import RelatedProduct from "../common/RelatedProduct";

export class Home extends Component {
  render() {
    return (
      <>
        {/* <HomeBanner /> */}
        <Features />
        <HomeCategory />
        <Product />
        <ExclusiveDeal />
        <Brand />
        <RelatedProduct />
        <Footer />
      </>
    );
  }
}

export default Home;
